(405,4070101,'_elementor_data','[{\"id\":\"1775ec4b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"55f00618\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"d1450a4\",\"elType\":\"widget\",\"settings\":{\"title\":\"Hey there! I am Xxxx, the creator, permanent leader and ideological inspirer of the Darth-Shop.ru project.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"8aea295\",\"elType\":\"widget\",\"settings\":{\"title\":\"About six years ago, I worked for hire and wandered through the vastness of the Internet in search of jewelry and accessories for myself and my apartment. And I found a lot of interesting products in the Star Wars universe. The ideas were wonderful, but all this beauty was abroad. We couldn‚Äôt find anything in Poland, and if there was anything, the prices were simply outrageous.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"b02f28a\",\"elType\":\"widget\",\"settings\":{\"title\":\"Then a simple thought arose: if there is me, there will probably be other fans who want to surround themselves with things with the symbols and heroes of the Galaxy Far, Far Away. And I have to help them!\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"e9b6cc6\",\"elType\":\"widget\",\"settings\":{\"title\":\"Two long years passed before I realized: this is no longer just a hobby, this is a Business. Business with a capital letter. What is interesting to me is interesting to other people - how can that not inspire? In 2016, the store acquired a business partner, and in the fall - its first real logo and real business cards - everything is serious :-D. At the beginning of 2017, a development strategy appeared and orders began to pour in.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"b7c1ce6\",\"elType\":\"widget\",\"settings\":{\"title\":\"Psychological education, more than nine years of experience in sales, and, of course, the love for Star Wars played a significant role in how I see this business: we love Star Wars, we love and respect clients, we are on the same wavelength with them, we always look for and find the most convenient payment method, delivery and other related services. We listen to wishes from the outside and always - constantly - expand our range, trying to present you with products that are difficult to find analogues (or simply do not exist).\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"aaa60fa\",\"elType\":\"widget\",\"settings\":{\"title\":\"For 2 years in a row, starting in 2017, we have been taking part in the Polish festival for Star Wars fans, and this event once again confirmed our conviction in the correctness of our chosen path.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"34af39f\",\"elType\":\"widget\",\"settings\":{\"title\":\"Our online store was created specifically for STAR WARS fans. We have prepared a large selection of goods based on the Star Wars universe, among which we try to offer exclusive items: clothing, shoes, accessories, jewelry, souvenirs. We even have piercing jewelry, plates and kitchen aprons! :) I like to follow trends in other areas and apply this to my business, finding interesting uses for unconventional materials and expanding the range with original products - which you look at and think: ‚ÄúDamn, this is exactly what I wanted! I just didn‚Äôt know that someone is doing this! We do it :)\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"03084de\",\"elType\":\"widget\",\"settings\":{\"title\":\"We invite you to please yourself or a loved one and order a couple of cool accessories. We will contact you in a convenient way (usually we write in messenger) and offer delivery and payment options. Read more about this on the relevant pages.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"5481997\",\"elType\":\"widget\",\"settings\":{\"title\":\"We make sure that you become our regular customers and surround yourself with only positive emotions through our products and services. And may the Force be with you!\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false}]'),
