(721,155000000,'_elementor_data','[{\"id\":\"9ba821c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"171da54\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"562eb00\",\"elType\":\"widget\",\"settings\":{\"title\":\"We guarantee the quality of our products and 100% compliance with all photographs and characteristics indicated on the site. Each item is checked upon receipt at the warehouse, as well as before dispatch to the buyer.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"0400ca3\",\"elType\":\"widget\",\"settings\":{\"title\":\"If the purchased product still does not suit you, you can return or exchange it within 7 days after purchase, provided that the product‚Äôs presentation, consumer properties are preserved before returning it to the seller, as well as documents confirming the purchase.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"d74354a\",\"elType\":\"widget\",\"settings\":{\"title\":\"Please note that some products are not subject to exchange or return, in particular, technically complex products (for example, watches), furniture, swimwear. In accordance with Art. XY.A of the Law on the Protection of Consumer Rights the consumer does not have the right to refuse a product of proper quality that has individually defined properties if the specified product can be used exclusively by the consumer purchasing it. Thus, souvenirs of proper quality, custom-made with an image or inscription chosen by the client, are not subject to exchange or return. The cost of delivery of goods of proper quality is subject to payment both for the return of unsuitable goods and for the subsequent delivery of goods for exchange.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"1ee32e1\",\"elType\":\"widget\",\"settings\":{\"title\":\"The return of the goods must be carried out through the transport company that delivered it to the buyer, to the office of the transport company:\\n\\n\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"1f061eb\",\"elType\":\"widget\",\"settings\":{\"title\":\"CDEK - Some address\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]},\"_margin\":{\"unit\":\"%\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"-3\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"7014425\",\"elType\":\"widget\",\"settings\":{\"title\":\"Boxberry - Some address 2\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]},\"_margin\":{\"unit\":\"%\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"-3\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"60a1406\",\"elType\":\"widget\",\"settings\":{\"title\":\"We will receive the shipment the next business day after receipt at the TC office.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"c7bce3a\",\"elType\":\"widget\",\"settings\":{\"title\":\"If there is a request for a refund of the amount paid for the goods, the funds are returned to the buyer within 14 working days in one of the following ways: simultaneously with the return of the goods at the TC office, in cash at the seller‚Äôs location, by postal transfer, by transferring the corresponding amount to a bank or other the buyer\'s account specified by the buyer. The method of compensation is discussed between the seller and the buyer individually in each specific case.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"d995f27\",\"elType\":\"widget\",\"settings\":{\"title\":\"According to Article 27. Rules for the sale of goods remotely in the event that a product is transferred to the buyer in violation of the terms of the contract regarding the quantity, assortment, quality, completeness, and (or) packaging of the goods, the buyer may notify the seller of these violations no later than 20 days after receiving the goods. If you find a manufacturing defect, please be sure to contact us; to speed up the process, attach photos or videos demonstrating the defect. We will review the situation and provide a response within the time limits established by law. Elimination of product defects is carried out as soon as possible, but cannot exceed 45 days; replacement of goods of inadequate quality is carried out within a month from the date of presentation of such a requirement.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"5cc9a84\",\"elType\":\"widget\",\"settings\":{\"title\":\"Contacts:\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"0a2ce35\",\"elType\":\"widget\",\"settings\":{\"selected_icon\":{\"value\":\"fas fa-phone\",\"library\":\"fa-solid\"},\"size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":8,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"icon\"},{\"id\":\"b42b755\",\"elType\":\"widget\",\"settings\":{\"title\":\"+48 XXXXXXXXX\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":92,\"sizes\":[]},\"_element_vertical_align\":\"center\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"08ae95c\",\"elType\":\"widget\",\"settings\":{\"selected_icon\":{\"value\":\"far fa-message\",\"library\":\"fa-regular\"},\"size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":8,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"icon\"},{\"id\":\"ae241ad\",\"elType\":\"widget\",\"settings\":{\"title\":\"not_manager@darth-shop.com\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":92,\"sizes\":[]},\"_element_vertical_align\":\"center\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"a347dd7\",\"elType\":\"widget\",\"settings\":{\"selected_icon\":{\"value\":\"far fa-envelope\",\"library\":\"fa-regular\"},\"size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":8,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"icon\"},{\"id\":\"c794d