(741,159000000,'_elementor_data','[{\"id\":\"277e32bf\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"777e6bde\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"5eaeff26\",\"elType\":\"widget\",\"settings\":{\"title\":\"We guarantee the quality of our products and 100% compliance with all photographs and characteristics indicated on the site. Each item is checked upon receipt at the warehouse, as well as before dispatch to the buyer.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"6d7992fa\",\"elType\":\"widget\",\"settings\":{\"title\":\"If the purchased product still does not suit you, you can return or exchange it within 7 days after purchase, provided that the product‚Äôs presentation, consumer properties are preserved before returning it to the seller, as well as documents confirming the purchase.\",\"header_size\":\"p\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"em\",\"size\":0.80000000000000004,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"f75882d\",\"elType\":\"widget\",\"settings\":{\"title\":\"Please note that some products are not subject to exchange or return, in particular, technically complex products (for example, watches), furniture, swimwear. In accordance with Art. XY.A of the Law on the Protection of Consumer Rights the consumer does not have the right to refuse a product of proper quality that has individually defined properties if the specified product can be used exclusively by the consumer purchasing it. Thus, souvenirs of proper quality, custom-made with an image or inscription chosen by the client, are not subject to exchange or return. The cost of delivery of goods of proper quality is subject to payment both f