(99,1070101,1,'Delivery','post','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>',1,'2024-11-24 02:45:18'),
(100,1070101,1,'Delivery','post','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>',1,'2024-11-24 02:45:36'),
(101,5070101,1,'Secure payment','post','<p>Dear clients!</p><p>At the moment we can offer you the following payment methods in our online store:</p>        \n        <p>Online payment by VISA, MasterCard or Maestro - both debit and credit. A link to payment will be sent after confirming the order in the messenger through which we will correspond with you: most often this is WhatsApp. Payment goes through the Bank payment gateway, and the transmitted data is protected by enhanced encryption. You will receive an electronic cash receipt immediately after payment.</p>        \n        <p>Electronic money: ApplePay, WebMoney, QIWI. The payment link will be sent in the same way, you will also receive an electronic cash receipt after payment.</p>        \n        <p>By bank card upon receipt - only for orders with courier delivery in Moscow. The courier will accept payment via a mobile terminal, and you will receive a beautiful paper receipt :)</p>',1,'2024-11-24 02:46:11'),
(102,5070101,1,'Secure payment','post','<p>Dear clients!</p><p>At the moment we can offer you the following payment methods in our online store:</p>        \n        <p>Online payment by VISA, MasterCard or Maestro - both debit and credit. A link to payment will be sent after confirming the order in the messenger through which we will correspond with you: most often this is WhatsApp. Payment goes through the Bank payment gateway, and the transmitted data is protected by enhanced encryption. You will receive an electronic cash receipt immediately after payment.</p>        \n        <p>Electronic money: ApplePay, WebMoney, QIWI. The payment link will be sent in the same way, you will also receive an electronic cash receipt after payment.</p>        \n        <p>By bank card upon receipt - only for orders with courier delivery in Moscow. The courier will accept payment via a mobile terminal, and you will receive a beautiful paper receipt :)</p>',1,'2024-11-24 02:46:42'),
