(130,1070101,1,'Delivery','post','<p>The assortment of our online store is constantly updated with goods from manufacturers and suppliers from different cities of Poland. Unfortunately, it is physically impossible to deliver goods from different cities in one parcel, but the site does not understand this :) Therefore, we indicated in the characteristics of each product the city of dispatch and the possibility of pickup. Please consider this point if you are not willing to pay for the delivery of several parcels.</p>',1,'2024-11-28 22:14:04'),
