(144,6070101,1,'Contacts','post','<h4>EStore</h4>        \n        <p>+48-xxx-xxx-xxx</p>        \n        <p><a href=\"mailto:some@address.com\">not_manager@darth-shop.com</a></p>        \n        <h6>Working hours:</h6><p>Monday-Friday - 12:00-18:00</p><p>Saturday-Sunday - Not working</p><p>Orders on the website, as well as all messages and letters are accepted around the clock. During non-working hours, as well as on weekends and holidays, the response time to your requests may be increased, but we still try to respond as quickly as possible.</p><h4>Pickup</h4><p>You can pick your paid order up from the warehouse at the address: Some address. The warehouse is located in a residential building, so an employee will meet you outside.</p><p>Please note: this is a warehouse, not a retail store - you won‚Äôt be able to select products on the spot.</p><p>Working hours: Mon-Fri 12:00-18:00, we agree on the exact time in advance. On weekends and after hours - if possible, we can arrange it.</p><iframe src=\"https://maps.google.com/maps?q=Poland%2C%20Gdansk&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\"></iframe><p><a href=\"http://localhost:8080/en/content/1-delivery\">You can find other delivery methods here.</a></p><h4>Details</h4><p>Individual entrepreneur: probably was there someday</p><p>Taxpayer identification number: in case you need it just call, but we don\'t remember either</p><p>Primary State Registration Number: actually, we still don\'t have one</p><p>Bank: we wish at least one of them approved us for a loan</p><p>Bank identification code: see the third one above</p><p>Correspondent account: was forgotten in the Alexandrian library</p><p>Bank account: was forbidden to be created by my mother</p>',0,'2024-11-29 00:19:20'),
(147,7070101,1,'Partnership','post','<h6>Do you love Star Wars as much as we do?</h6><h6>Do you want to benefit the fans of the Universe, share your thoughts, help us become better? We invite you to develop together!</h6><h6>We need interns, beginners, specialists - we will consider everyone!\n</h6>',1,'2024-11-28 23:45:07'),
