(152,7070101,1,'Partnership','post','<h6>Do you love Star Wars as much as we do?</h6><h6>Do you want to benefit the fans of the Universe, share your thoughts, help us become better? We invite you to develop together!</h6><h6>We need interns, beginners, specialists - we will consider everyone!\n</h6><h6>If you don‚Äôt consider yourself to belong to any of the above categories, but want to work with us, still call and write, and together we‚Äôll come up with something.</h6><h6>Who do we need:</h6><p> - Designers, illustrators, artists</p><p>What to do: create images for our products and/or blog and social media posts</p><p>Cooperation options: free publications indicating an active link to the author/payment for each work with transfer of ownership/percentage from sales of goods using the author\'s prints.</p><p>- Suppliers/Manufacturers</p><p>What to do: produce cool goods in the Star Wars Universe - badges, magnets, jewelry, lamps, covers... We are especially interested in laser cutting, 3D printing and sublimation, preferably in Gdansk or the region. We can provide our own basics and consumables.</p><p>Cooperation options: prepayment or postpayment, cash/non-cash, delivery/pickup.</p><p>Our offers are not limited to this! Write with any questions or suggestions:</p><p>VK</p><p>All messengers: +48-xxx-xxx-xxx</p><p>Email: not_manager@darth-shop.com</p>',1,'2024-11-28 23:48:07'),
(153,2070101,1,'Legal Notice','post','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>',1,'2024-11-28 23:48:55'),
(155,9070101,1,'Returns','post','<p>We guarantee the quality of our products and 100% compliance with all photographs and characteristics indicated on the site. Each item is checked upon receipt at the warehouse, as well as before dispatch to the buyer.</p><p>If the purchased product still does not suit you, you can return or exchange it within 7 days after purchase, provided that the product‚Äôs presentation, consumer properties are preserved before returning it to the seller, as well as documents confirming the purchase.</p><p>Please note that some products are not subject to exchange or return, in particular, technically complex products (for example, watches), furniture, swimwear. In accordance with Art. XY.Z of the Law on the Protection of Consumer Rights the consumer does not have the right to refuse a product of proper quality that has individually defined properties if the specified product can be used exclusively by the consumer purchasing it. Thus, souvenirs of proper quality, custom-made with an image or inscription chosen by the client, are not subject to exchange or return. The cost of delivery of goods of proper quality is subject to payment both for the return of unsuitable goods and for the subsequent delivery of goods for exchange.</p><p>The return of the goods must be carried out through the transport company that delivered it to the buyer, to the office of the transport company:\n</p><p>CDEK - Some address</p><p>Boxberry - Some address 2</p><p>We will receive the shipment the next business day after receipt at the TC office.</p><p>If there is a request for a refund of the amount paid for the goods, the funds are returned to the buyer within 14 working days in one of the following ways: simultaneously with the return of the goods at the TC office, in cash at the seller‚Äôs location, by postal transfer, by transferring the corresponding amount to a bank or other the buyer\'s account specified by the buyer. The method of compensation is discussed between the seller and the buyer individually in each specific case.</p><p>According to Article 27. Rules for the sale of goods remotely in the event that a product is transferred to the buyer in violation of the terms of the contract regarding the quantity, assortment, quality, completeness, and (or) packaging of the goods, the buyer may notify the seller of these violations no later than 20 days after receiving the goods. If you find a manufacturing defect, please be sure to contact us; to speed up the process, attach photos or videos demonstrating the defect. We will review the situation and provide a response within the time limits established by law. Elimination of product defects is carried out as soon as possible, but cannot exceed 45 days; replacement of goods of inadequate quality is carried out within a month from the date of presentation of such a requirement.</p><p>Contacts:</p>        \n        <p>+48 XXXXXXXXX</p>        \n        <p>not_manager@darth-shop.com</p>        \n        <p><a href=\"http://localhost:8080/en/content/6-contacts\">To submit a written application, use the details indicated on the Contacts page</a></p>',1,'2024-11-28 23:54:09'),
