(170,3070101,1,'Terms and conditions of use','post','<p>Information provided by the Client:</p><p>When registering in the online store, the Client provides the following information: login, email address, password to access the Site. When placing an order, the Client provides the following information: Last name, First name, address for delivery of orders, contact phone number, email address.</p><p>Indication of personal data during authorization/registration in the online store means the Client‚Äôs consent to the processing of this data by Individual Entrepreneur X. Y. ABCDEFG. (hereinafter referred to as the Seller) for the following purposes:</p><p>- Fulfillment by the Seller of obligations to the Client (sale of goods/services), incl. transfer of specified data to representatives of transport companies upon delivery of goods;</p><p>- Providing reference information and advice on the product/service;</p><p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p><p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p><p>When processing the Client‚Äôs personal data, the Seller is guided by the Federal Law ‚ÄúOn Personal Data‚Äù and local regulatory documents.\nThe Seller has the right to send advertising and information messages to the Client. If the Client wants to unsubscribe from receiving mailings from the Seller, he must change the appropriate subscription settings in the section: ‚ÄúPersonal Account‚Äù - ‚ÄúGeneral Information‚Äù. To log in you must enter your username and password.</p><p>Purposes of use by the Seller of the information provided by the Client.</p><p>The Seller has the right to use the information received from the Client for the following purposes:</p><p>- Registration/authorization of the Client on the Site;</p><p>- Processing the Client\'s orders and fulfilling the Seller\'s obligations to the Client;</p><p>- Carrying out activities to inform and promote goods and services.</p><p>Providing and transferring information that the Seller receives from the Client:</p><p>- The Seller undertakes not to transfer information received from the Client to third parties, with the exception of cases of transfer of information to agents and third parties who act on the basis of an agreement with the Seller in order to fulfill obligations to the Client.</p><p>- The Seller may transfer information about the Client in cases and in accordance with reasonable and applicable requirements of the legislation of the Republic of Poland.</p><p>- The seller has the right to use ‚Äúcookies‚Äù technology. This technology does not contain confidential information and is not transferred to third parties.</p><p>- The seller can obtain data about the IP address of the online store visitor and additional information about the source of the visit (from which Internet site the visit was made). The information received cannot be used to identify the visitor.</p><p>- The Seller is not responsible for publicly available information provided by the Client on the online store Website.</p><p>- When collecting, processing and storing personal data, the seller takes all necessary and sufficient measures to protect organizational and technical nature from unauthorized access, as well as from other unlawful actions in relation to personal data. The period for processing and storing the Client‚Äôs personal data corresponds to the period of service of the Client by the Seller and is no more than 2 years from the date of termination of cooperation.</p><p>The client has the right to cancel consent to the processing of personal data by sending a corresponding letter to the address: info@darth-shop.ru. In case of withdrawal of consent, the Client is obliged to immediately leave this site.</p>',1,'2024-11-29 00:24:39'),
