(7,1,'darth-shop_404_page','page-not-found','<h1>404</h1><h1>Page not found</h1><h3>Probable reasons:</h3>The page was removed or replaced by administratorIncorrect link to the pageIncorrect type or address URLYou may return to the main page or to the catalogue',0,1,'2024-11-22 20:02:24','2024-11-22 20:02:24'),
(8,1,'darth-shop_main_page','page-index','<img src=\"/img/cms/carou_first.png\" alt=\"\" width=\"1920\" height=\"560\" /><img src=\"/img/cms/carou_second.png\" alt=\"\" width=\"1920\" height=\"560\" /><img src=\"/img/cms/carou_third.jpg\" alt=\"\" width=\"1180\" height=\"554\" />\n                                        Previous\n                                        Next\n        <h6>Welcome to the best electronic shop for the fans of STAR WARS!</h6><h4>New</h4><p>All new</p><h4>On sale</h4><p>All on sale</p><h6>The best way to know about new supplies - just to subscribe to our news</h6><p>Subscribe to our news!</p>        <form action=\"//localhost:8080/en/module/creativeelements/ajax\" method=\"post\">\n            <input type=\"hidden\" name=\"action\" value=\"0\" />\n                <input name=\"email\" />\n                <button type=\"submit\" name=\"submitNewsletter\" value=\"1\">\n                                                                Subscribe\n                </button>\n                </form>\n        <p>* By filling this form in and pushing the \"Subscribe\" button you confirm your legal capacity  and give consent to the processing of personal data</p>',0,1,'2024-11-22 22:30:22','2024-11-22 22:30:22'),
