(14,1,'darth-shop_category_page','listing-category','',0,1,'2024-11-24 01:20:33','2024-11-24 01:20:33'),
(17,1,'darth-shop_about_us','page','<p>Hey there! I am Xxxx, the creator, permanent leader and ideological inspirer of the Darth-Shop.ru project.</p><p>About six years ago, I worked for hire and wandered through the vastness of the Internet in search of jewelry and accessories for myself and my apartment. And I found a lot of interesting products in the Star Wars universe. The ideas were wonderful, but all this beauty was abroad. We couldn‚Äôt find anything in Poland, and if there was anything, the prices were simply outrageous.</p><p>Then a simple thought arose: if there is me, there will probably be other fans who want to surround themselves with things with the symbols and heroes of the Galaxy Far, Far Away. And I have to help them!</p><p>Two long years passed before I realized: this is no longer just a hobby, this is a Business. Business with a capital letter. What is interesting to me is interesting to other people - how can that not inspire? In 2016, the store acquired a business partner, and in the fall - its first real logo and real business cards - everything is serious :-D. At the beginning of 2017, a development strategy appeared and orders began to pour in.</p><p>Psychological education, more than nine years of experience in sales, and, of course, the love for Star Wars played a significant role in how I see this business: we love Star Wars, we love and respect clients, we are on the same wavelength with them, we always look for and find the most convenient payment method, delivery and other related services. We listen to wishes from the outside and always - constantly - expand our range, trying to present you with products that are difficult to find analogues (or simply do not exist).</p><p>For 2 years in a row, starting in 2017, we have been taking part in the Polish festival for Star Wars fans, and this event once again confirmed our conviction in the correctness of our chosen path.</p><p>Our online store was created specifically for STAR WARS fans. We have prepared a large selection of goods based on the Star Wars universe, among which we try to offer exclusive items: clothing, shoes, accessories, jewelry, souvenirs. We even have piercing jewelry, plates and kitchen aprons! :) I like to follow trends in other areas and apply this to my business, finding interesting uses for unconventional materials and expanding the range with original products - which you look at and think: ‚ÄúDamn, this is exactly what I wanted! I just didn‚Äôt know that someone is doing this! We do it :)</p><p>We invite you to please yourself or a loved one and order a couple of cool accessories. We will contact you in a convenient way (usually we write in messenger) and offer delivery and payment options. Read more about this on the relevant pages.</p><p>We make sure that you become our regular customers and surround yourself with only positive emotions through our products and services. And may the Force be with you!</p>',0,1,'2024-11-24 02:28:13','2024-11-24 02:28:13'),
(20,1,'darth-shop_payment','page','<p>Dear clients!</p><p>At the moment we can offer you the following payment methods in our online store:</p>        \n        <p>Online payment by VISA, MasterCard or Maestro - both debit and credit. A link to payment will be sent after confirming the order in the messenger through which we will correspond with you: most often this is WhatsApp. Payment goes through the Bank payment gateway, and the transmitted data is protected by enhanced encryption. You will receive an electronic cash receipt immediately after payment.</p>        \n        <p>Electronic money: ApplePay, WebMoney, QIWI. The payment link will be sent in the same way, you will also receive an electronic cash receipt after payment.</p>        \n        <p>By bank card upon receipt - only for orders with courier delivery in Moscow. The courier will accept payment via a mobile terminal, and you will receive a beautiful paper receipt :)</p>',0,1,'2024-11-24 02:47:57','2024-11-24 02:47:57'),
(22,1,'darth-shop_header','header','Your city is: <a href=\"http://localhost:8080/en/content/4-about-us\">About us</a><a href=\"http://localhost:8080/en/content/5-secure-payment\">Payment</a><a href=\"http://localhost:8080/en/content/1-delivery\">Delivery</a><a href=\"http://localhost:8080/en/content/9-returns\">Returns</a><a href=\"http://localhost:8080/en/content/6-contacts\">Contacts</a><a href=\"http://localhost:8080/en/content/7-partnership\">Partnership</a><a href=\"http://localhost:8080/en/content/8-reviews\">Reviews</a><a href=\"http://localhost:8080/en/login?back=my-account\">Log In</a><a href=\"http://localhost:8080/en/login?create_account=1\">Registration</a>        \n                            <a>\n                    <img src=\"/img/cms/darth-logo.png\" alt=\"\" width=\"165\" height=\"184\" />                    </a>\n                <form action=\"http://localhost:8080/en/search\" method=\"get\">\n                            <input name=\"s\" value=\"\" />\n                            <button type=\"submit\">\n                                                        Search\n                                </button>\n        </form>\n        <h2>+48-xxx-xxx-xxx\n</h2><h6>Call or message us in WhatsApp or Messanger</h6><h6><a href=\"http://localhost:8080/en/contact-us\">Send an email</a></h6>',0,1,'2024-11-24 03:06:39','2024-11-24 03:06:39'),
(23,1,'darth-shop_footer','footer','<h1>Your account</h1><p><a href=\"http://localhost:8080/en/login?back=my-account\">Log in</a></p><p><a href=\"http://localhost:8080/en/login?create_account=1\">Registration</a></p><p><a href=\"http://localhost:8080/en/password-recovery\">Forgot your password?</a></p><h1>Service</h1><p><a href=\"http://localhost:8080/en/content/5-secure-payment\">Payment</a></p><p><a href=\"http://localhost:8080/en/content/1-delivery\">Delivery</a></p><p><a href=\"http://localhost:8080/en/content/9-returns\">Returns</a></p><p><a href=\"http://localhost:8080/en/content/3-terms-and-conditions-of-use\">Terms and conditions of use</a></p><h1>Our company</h1><p><a href=\"http://localhost:8080/en/content/4-about-us\">About us</a></p><p><a>Contacts</a></p><p><a href=\"http://localhost:8080/en/content/7-partnership\">Partnership</a></p><p><a href=\"http://localhost:8080/en/content/8-reviews\">Reviews</a></p><h1>Social networks</h1>        \n        <p><a href=\"http://localhost:8080\">VKontakte</a></p>        \n        <p><a href=\"http://localhost:8080\">Facebook</a></p>        \n        <p><a href=\"http://localhost:8080\">Instagram</a></p>',0,1,'2024-11-24 03:07:08','2024-11-24 03:07:09'),
(25,1,'darth-shop_delivery','page','<p>The assortment of our online store is constantly updated with goods from manufacturers and suppliers from different cities of Poland. Unfortunately, it is physically impossible to deliver goods from different cities in one parcel, but the site does not understand this :) Therefore, we indicated in the characteristics of each product the city of dispatch and the possibility of pickup. Please consider this point if you are not willing to pay for the delivery of several parcels.</p><p>Orders are transferred to courier services on weekdays at 14:00-15:00.</p>',0,1,'2024-11-28 22:13:58','2024-11-28 22:13:59'),
(27,1,'darth-shop_contacts','page','<h4>EStore</h4>        \n        <p>+48-xxx-xxx-xxx</p>        \n        <p><a href=\"mailto:some@address.com\">not_manager@darth-shop.com</a></p>        \n        <h6>Working hours:</h6><p>Monday-Friday - 12:00-18:00</p><p>Saturday-Sunday - Not working</p><p>Orders on the website, as well as all messages and letters are accepted around the clock. During non-working hours, as well as on weekends and holidays, the response time to your requests may be increased, but we still try to respond as quickly as possible.</p><h4>Pickup</h4><p>You can pick your paid order up from the warehouse at the address: Some address. The warehouse is located in a residential building, so an employee will meet you outside.</p><p>Please note: this is a warehouse, not a retail store - you won‚Äôt be able to select products on the spot.</p><p>Working hours: Mon-Fri 12:00-18:00, we agree on the exact time in advance. On weekends and after hours - if possible, we can arrange it.</p><iframe src=\"https://maps.google.com/maps?q=Poland%2C%20Gdansk&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\"></iframe><p><a href=\"http://localhost:8080/en/content/1-delivery\">You can find other delivery methods here.</a></p><h4>Details</h4><p>Individual entrepreneur: probably was there someday</p><p>Taxpayer identification number: in case you need it just call, but we don\'t remember either</p><p>Primary State Registration Number: actually, we still don\'t have one</p><p>Bank: we wish at least one of them approved us for a loan</p><p>Bank identification code: see the third one above</p><p>Correspondent account: was forgotten in the Alexandrian library</p><p>Bank account: was forbidden to be created by my mother</p>',0,1,'2024-11-28 23:22:35','2024-11-28 23:22:36'),
(30,1,'darth-shop_partnership','page','<h6>Do you love Star Wars as much as we do?</h6><h6>Do you want to benefit the fans of the Universe, share your thoughts, help us become better? We invite you to develop together!</h6><h6>We need interns, beginners, specialists - we will consider everyone!\n</h6><h6>If you don‚Äôt consider yourself to belong to any of the above categories, but want to work with us, still call and write, and together we‚Äôll come up with something.</h6><h6>Who do we need:</h6><p> - Designers, illustrators, artists</p><p>What to do: create images for our products and/or blog and social media posts</p><p>Cooperation options: free publications indicating an active link to the author/payment for each work with transfer of ownership/percentage from sales of goods using the author\'s prints.</p><p>- Suppliers/Manufacturers</p><p>What to do: produce cool goods in the Star Wars Universe - badges, magnets, jewelry, lamps, covers... We are especially interested in laser cutting, 3D printing and sublimation, preferably in Gdansk or the region. We can provide our own basics and consumables.</p><p>Cooperation options: prepayment or postpayment, cash/non-cash, delivery/pickup.</p><p>Our offers are not limited to this! Write with any questions or suggestions:</p><p>VK</p><p>All messengers: +48-xxx-xxx-xxx</p><p>Email: not_manager@darth-shop.com</p>',0,1,'2024-11-28 23:48:00','2024-11-28 23:48:00'),
(32,1,'darth-shop_returns','page','<p>We guarantee the quality of our products and 100% compliance with all photographs and characteristics indicated on the site. Each item is checked upon receipt at the warehouse, as well as before dispatch to the buyer.</p><p>If the purchased product still does not suit you, you can return or exchange it within 7 days after purchase, provided that the product‚Äôs presentation, consumer properties are preserved before returning it to the seller, as well as documents confirming the purchase.</p><p>Please note that some products are not subject to exchange or return, in particular, technically complex products (for example, watches), furniture, swimwear. In accordance with Art. XY.A of the Law on the Protection of Consumer Rights the consumer does not have the right to refuse a product of proper quality that has individually defined properties if the specified product can be used exclusively by the consumer purchasing it. Thus, souvenirs of proper quality, custom-made with an image or inscription chosen by the client, are not subject to exchange or return. The cost of delivery of goods of proper quality is subject to payment both for the return of unsuitable goods and for the subsequent delivery of goods for exchange.</p><p>The return of the goods must be carried out through the transport company that delivered it to the buyer, to the office of the transport company:\n</p><p>CDEK - Some address</p><p>Boxberry - Some address 2</p><p>We will receive the shipment the next business day after receipt at the TC office.</p><p>If there is a request for a refund of the amount paid for the goods, the funds are returned to the buyer within 14 working days in one of the following ways: simultaneously with the return of the goods at the TC office, in cash at the seller‚Äôs location, by postal transfer, by transferring the corresponding amount to a bank or other the buyer\'s account specified by the buyer. The method of compensation is discussed between the seller and the buyer individually in each specific case.</p><p>According to Article 27. Rules for the sale of goods remotely in the event that a product is transferred to the buyer in violation of the terms of the contract regarding the quantity, assortment, quality, completeness, and (or) packaging of the goods, the buyer may notify the seller of these violations no later than 20 days after receiving the goods. If you find a manufacturing defect, please be sure to contact us; to speed up the process, attach photos or videos demonstrating the defect. We will review the situation and provide a response within the time limits established by law. Elimination of product defects is carried out as soon as possible, but cannot exceed 45 days; replacement of goods of inadequate quality is carried out within a month from the date of presentation of such a requirement.</p><p>Contacts:</p>        \n        <p>+48 XXXXXXXXX</p>        \n        <p>not_manager@darth-shop.com</p>        \n        <p><a href=\"http://localhost:8080/en/content/6-contacts\">To submit a written application, use the details indicated on the Contacts page</a></p>',0,1,'2024-11-28 23:55:06','2024-11-28 23:55:06'),
(36,1,'darth-shop_terms_of_use','page','<p>Information provided by the Client:</p><p>When registering in the online store, the Client provides the following information: login, email address, password to access the Site. When placing an order, the Client provides the following information: Last name, First name, address for delivery of orders, contact phone number, email address.</p><p>Indication of personal data during authorization/registration in the online store means the Client‚Äôs consent to the processing of this data by Individual Entrepreneur X. Y. ABCDEFG. (hereinafter referred to as the Seller) for the following purposes:</p><p>- Fulfillment by the Seller of obligations to the Client (sale of goods/services), incl. transfer of specified data to representatives of transport companies upon delivery of goods;</p><p>- Providing reference information and advice on the product/service;</p><p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p><p>When processing the Client‚Äôs personal data, the Seller is guided by the Federal Law ‚ÄúOn Personal Data‚Äù and local regulatory documents.\nThe Seller has the right to send advertising and information messages to the Client. If the Client wants to unsubscribe from receiving mailings from the Seller, he must change the appropriate subscription settings in the section: ‚ÄúPersonal Account‚Äù - ‚ÄúGeneral Information‚Äù. To log in you must enter your username and password.</p><p>Purposes of use by the Seller of the information provided by the Client.</p><p>The Seller has the right to use the information received from the Client for the following purposes:</p><p>- Registration/authorization of the Client on the Site;</p><p>- Processing the Client\'s orders and fulfilling the Seller\'s obligations to the Client;</p><p>- Carrying out activities to inform and promote goods and services.</p><p>Providing and transferring information that the Seller receives from the Client:</p><p>- The Seller undertakes not to transfer information received from the Client to third parties, with the exception of cases of transfer of information to agents and third parties who act on the basis of an agreement with the Seller in order to fulfill obligations to the Client.</p><p>- The Seller may transfer information about the Client in cases and in accordance with reasonable and applicable requirements of the legislation of the Republic of Poland.</p><p>- The seller has the right to use ‚Äúcookies‚Äù technology. This technology does not contain confidential information and is not transferred to third parties.</p><p>- The seller can obtain data about the IP address of the online store visitor and additional information about the source of the visit (from which Internet site the visit was made). The information received cannot be used to identify the visitor.</p><p>- The Seller is not responsible for publicly available information provided by the Client on the online store Website.</p><p>- When collecting, processing and storing personal data, the seller takes all necessary and sufficient measures to protect organizational and technical nature from unauthorized access, as well as from other unlawful actions in relation to personal data. The period for processing and storing the Client‚Äôs personal data corresponds to the period of service of the Client by the Seller and is no more than 2 years from the date of termination of cooperation.</p><p>The client has the right to cancel consent to the processing of personal data by sending a corresponding letter to the address: info@darth-shop.ru. In case of withdrawal of consent, the Client is obliged to immediately leave this site.</p>',0,1,'2024-11-29 00:27:28','2024-11-29 00:27:29');
