INSERT INTO `ps_cms_lang` VALUES
(1,1,1,'Delivery','Delivery  ‚Äì darth-shop.com','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p>The assortment of our online store is constantly updated with goods from manufacturers and suppliers from different cities of Poland. Unfortunately, it is physically impossible to deliver goods from different cities in one parcel, but the site does not understand this :) Therefore, we indicated in the characteristics of each product the city of dispatch and the possibility of pickup. Please consider this point if you are not willing to pay for the delivery of several parcels.</p>\n<p>Orders are transferred to courier services on weekdays at 14:00-15:00.</p>','delivery'),
(1,2,1,'Delivery','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
(1,3,1,'Delivery','Delivery  ‚Äì darth-shop.com','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p>The assortment of our online store is constantly updated with goods from manufacturers and suppliers from different cities of Poland. Unfortunately, it is physically impossible to deliver goods from different cities in one parcel, but the site does not understand this :) Therefore, we indicated in the characteristics of each product the city of dispatch and the possibility of pickup. Please consider this point if you are not willing to pay for the delivery of several parcels.</p>\n<p>Orders are transferred to courier services on weekdays at 14:00-15:00.</p>','delivery'),
(2,1,1,'Legal Notice','','Legal notice','notice, legal, credits','<p>Information provided by the Client:</p><p>When registering in the online store, the Client provides the following information: login, email address, password to access the Site. When placing an order, the Client provides the following information: Last name, First name, address for delivery of orders, contact phone number, email address.</p><p>Indication of personal data during authorization/registration in the online store means the Client‚Äôs consent to the processing of this data by Individual Entrepreneur X. Y. ABCDEFG. (hereinafter referred to as the Seller) for the following purposes:</p><p>- Fulfillment by the Seller of obligations to the Client (sale of goods/services), incl. transfer of specified data to representatives of transport companies upon delivery of goods;</p><p>- Providing reference information and advice on the product/service;</p><p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p><p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p><p>When processing the Client‚Äôs personal data, the Seller is guided by the Federal Law ‚ÄúOn Personal Data‚Äù and local regulatory documents.\nThe Seller has the right to send advertising and information messages to the Client. If the Client wants to unsubscribe from receiving mailings from the Seller, he must change the appropriate subscription settings in the section: ‚ÄúPersonal Account‚Äù - ‚ÄúGeneral Information‚Äù. To log in you must enter your username and password.</p><p>Purposes of use by the Seller of the information provided by the Client.</p><p>The Seller has the right to use the information received from the Client for the following purposes:</p><p>- Registration/authorization of the Client on the Site;</p><p>- Processing the Client\'s orders and fulfilling the Seller\'s obligations to the Client;</p><p>- Carrying out activities to inform and promote goods and services.</p>','legal-notice'),
(2,2,1,'Legal Notice','','Legal notice','notice, legal, credits','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>','legal-notice'),
