(3,1,1,'Terms and conditions of use','Terms and conditions ‚Äì darth-shop.com','Our terms and conditions of use','conditions, terms, use, sell','<p>Information provided by the Client:</p>\n<p>When registering in the online store, the Client provides the following information: login, email address, password to access the Site. When placing an order, the Client provides the following information: Last name, First name, address for delivery of orders, contact phone number, email address.</p>\n<p>Indication of personal data during authorization/registration in the online store means the Client‚Äôs consent to the processing of this data by Individual Entrepreneur X. Y. ABCDEFG. (hereinafter referred to as the Seller) for the following purposes:</p>\n<p>- Fulfillment by the Seller of obligations to the Client (sale of goods/services), incl. transfer of specified data to representatives of transport companies upon delivery of goods;</p>\n<p>- Providing reference information and advice on the product/service;</p>\n<p>in order to promote goods and services, inform about product range updates/appearance of new goods and services</p>\n<p>When processing the Client‚Äôs personal data, the Seller is guided by the Federal Law ‚ÄúOn Personal Data‚Äù and local regulatory documents. The Seller has the right to send advertising and information messages to the Client. If the Client wants to unsubscribe from receiving mailings from the Seller, he must change the appropriate subscription settings in the section: ‚ÄúPersonal Account‚Äù - ‚ÄúGeneral Information‚Äù. To log in you must enter your username and password.</p>\n<p>Purposes of use by the Seller of the information provided by the Client.</p>\n<p>The Seller has the right to use the information received from the Client for the following purposes:</p>\n<p>- Registration/authorization of the Client on the Site;</p>\n<p>- Processing the Client\'s orders and fulfilling the Seller\'s obligations to the Client;</p>\n<p>- Carrying out acti