(4,1,1,'About us','About us ‚Äì darth-shop.com','Learn more about us','about us, informations','<p>Hey there! I am Xxxx, the creator, permanent leader and ideological inspirer of the Darth-Shop.ru project.</p>\n<p>About six years ago, I worked for hire and wandered through the vastness of the Internet in search of jewelry and accessories for myself and my apartment. And I found a lot of interesting products in the Star Wars universe. The ideas were wonderful, but all this beauty was abroad. We couldn‚Äôt find anything in Poland, and if there was anything, the prices were simply outrageous.</p>\n<p>Then a simple thought arose: if there is me, there will probably be other fans who want to surround themselves with things with the symbols and heroes of the Galaxy Far, Far Away. And I have to help them!</p>\n<p>Two long years passed before I realized: this is no longer just a hobby, this is a Business. Business with a capital letter. What is interesting to me is interesting to other people - how can that not inspire? In 2016, the store acquired a business partner, and in the fall - its first real logo and real business cards - everything is serious :-D. At the beginning of 2017, a development strategy appeared and orders began to pour in.</p>\n<p>Psychological education, more than nine years of experience in sales, and, of course, the love for Star Wars played a significant role in how I see this business: we love Star Wars, we love and respect clients, we are on the same wavelength with them, we always look for and find the most convenient payment method, delivery and other related services. We listen to wishes from the outside and always - constantly - expand our range, trying to present you with products that are difficult to find analogues (or simply do not exist).</p>\n<p>For 2 years in a row, starting in 2017, we have been taking part in the Polish festival for Star Wars fans, and this event once again confirmed our conviction in the correctness of our chosen path.</p>\n<p>Our online store was created specifically for STAR WARS fans. We have prepared a large selection of goods based on the Star Wars universe, among which we try to offer exclusive items: clothing, shoes, accessories, jewelry, souvenirs. We even have piercing jewelry, plates and kitchen aprons! :) I like to follow trends in other areas and apply this to my business, finding interesting uses for unconventional materials and expanding the range with original products - which you look at and think: ‚ÄúDamn, this is exactly what I wanted! I just didn‚Äôt know that someone is doing this! We do it :)</p>\n<p>We invite you to please yourself or a loved one and order a couple of cool accessories. We will contact you in a convenient way (usually we write in messenger) and offer delivery and payment options. Read more about this on the relevant pages.</p>\n<p>We make sure that you become our regular customers and surround yourself with only positive emotions through our products and services. And may the Force be with you!</p>','about-us'),
(4,2,1,'About us','','Learn more about us','about us, informations','<h1 class=\"page-heading bottom-indent\">About us</h1>\n<div class=\"row\">\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-block\">\n<h3 class=\"page-subheading\">Our company</h3>\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididun.</strong></p>\n<p>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam. Lorem ipsum dolor sit amet conse ctetur adipisicing elit.</p>\n<ul class=\"list-1\">\n<li><em class=\"icon-ok\"></em>Top quality products</li>\n<li><em class=\"icon-ok\"></em>Best customer service</li>\n<li><em class=\"icon-ok\"></em>30-days money back guarantee</li>\n</ul>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Our team</h3>\n<p><strong class=\"dark\">Lorem set sint occaecat cupidatat non </strong></p>\n<p>Eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo.</p>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Testimonials</h3>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">‚Äú</span>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim.<span class=\"after\">‚Äù</span></div>\n</div>\n<p><strong class=\"dark\">Lorem ipsum dolor sit</strong></p>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">‚Äú</span>Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod.<span class=\"after\">‚Äù</s