(6,3,1,'Contacts','Contacts ‚Äì darth-shop.com','A page with all contact data a user may need','','<h4>EStore</h4>\n<p>+48-xxx-xxx-xxx</p>\n<p><a href=\"mailto:some@address.com\">not_manager@darth-shop.com</a></p>\n<h6>Working hours:</h6>\n<p>Monday-Friday - 12:00-18:00</p>\n<p>Saturday-Sunday - Not working</p>\n<p>Orders on the website, as well as all messages and letters are accepted around the clock. During non-working hours, as well as on weekends and holidays, the response time to your requests may be increased, but we still try to respond as quickly as possible.</p>\n<h4>Pickup</h4>\n<p>You can pick your paid order up from the warehouse at the address: Some address. The warehouse is located in a residential building, so an employee will meet you outside.</p>\n<p>Please note: this is a warehouse, not a retail store - you won‚Äôt be able to select products on the spot.</p>\n<p>Working hours: Mon-Fri 12:00-18:00, we agree on the exact time in advance. On weekends and after hours - if possible, we can arrange it.</p>\n<p><iframe width=\"300\" height=\"150\" src=\"https://maps.google.com/maps?q=Poland%2C%20Gdansk&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\"></iframe></p>\n<p><a href=\"http://localhost:8080/en/content/1-delivery\">You can find other delivery methods here.</a></p>\n<h4>Details</h4>\n<p>Individual entrepreneur: probably was there someday</p>\n<p>Taxpayer identification number: in case you need it just call, but we don\'t remember either</p>\n<p>Primary State Registration Number: actually, we still don\'t have one</p>\n<p>Bank: we wish at least one of them approved us for a loan</p>\n<p>Bank identification code: see the third one above</p>\n<p>Correspondent account: was forgotten in the Alexandrian library</p>\n<p>Bank account: was forbidden to be created by my mother</p>','contacts'),
(7,1,1,'Partnership','Partnership ‚Äì darth-shop.com','','','<h6>Do you love Star Wars as much as we do?</h6>\n<h6>Do you want to benefit the fans of the Universe, share your thoughts, help us become better? We invite you to develop together!</h6>\n<h6>We need interns, beginners, specialists - we will consider everyone!</h6>\n<h6>If you don‚Äôt consider yourself to belong to any of the above categories, but want to work with us, still call and write, and together we‚Äôll come up with something.</h6>\n<h6>Who do we need:</h6>\n<p>- Designers, illustrators, artists</p>\n<p>What to do: create images for our products and/or blog and social media posts</p>\n<p>Cooperation options: free publications indicating an active link to the author/payment for each work with transfer of ownership/percentage from sales of goods using the author\'s prints.</p>\n<p>- Suppliers/Manufacturers</p>\n<p>What to do: produce cool goods in the Star Wars Universe - badges, magnets, jewelry, lamps, covers... We are especially interested in laser cutting, 3D printing and sublimation, preferably in Gdansk or the region. We can provide our own basics and consumables.</p>\n<p>Cooperation options: prepayment or postpayment, cash/non-cash, delivery/pickup.</p>\n<p>Our offers are not limited to this! Write with any questions or suggestions:</p>\n<p>VK</p>\n<p>All messengers: +48-xxx-xxx-xxx</p>\n<p>Email: not_manager@darth-shop.com</p>','partnership'),
