(9,1,1,'Returns','Returns ‚Äì darth-shop.com','Page contaning all the neccessary information to make a successfull return','','<p>We guarantee the quality of our products and 100% compliance with all photographs and characteristics indicated on the site. Each item is checked upon receipt at the warehouse, as well as before dispatch to the buyer.</p>\n<p>If the purchased product still does not suit you, you can return or exchange it within 7 days after purchase, provided that the product‚Äôs presentation, consumer properties are preserved before returning it to the seller, as well as documents confirming the purchase.</p>\n<p>Please note that some products are not subject to exchange or return, in particular, technically complex products (for example, watches), furniture, swimwear. In accordance with Art. XY.A of the Law on the Protection of Consumer Rights the consumer does not have the right to refuse a product of proper quality that has individually defined properties if the specified product can be used exclusively by the consumer purchasing it. Thus, souvenirs of proper quality, custom-made with an image or inscription chosen by the client, are not subject to exchange or return. The cost of delivery of goods of proper quality is subject to payment both for the return of unsuitable goods and for the subsequent delivery of goods for exchange.</p>\n<p>The return of the goods must be carried out through the transport company that delivered it to the buyer, to the office of the transport company:</p>\n<p>CDEK - Some address</p>\n<p>Boxberry - Some address 2</p>\n<p>We will receive the shipment the next business day after receipt at the TC office.</p>\n<p>If there is a request for a refund of the amount paid for the goods, the funds are returned to the buyer within 14 working days in one of the following ways: simultaneously with the return of the goods at the TC office, in cash at the seller‚Äôs location, by postal transfer, by transferring the corresponding amount to a bank or other the buyer\'s account specified by the buyer. The method of compensation is discussed between the seller and the buyer individually in each specific case.</p>\n<p>According to Article 27. Rules for the sale of goods remotely in the event that a product is transferred to the buyer in violation of the terms of the contract regarding the quantity, assortment, quality, completeness, and (or) packaging of the goods, the buyer may notify the seller of these violations no later than 20 days after receiving the goods. If you find a manufacturing defect, please be sure to contact us; to speed up the process, attach photos or videos demonstrating the defect. We will review the situation and provide a response within the time limits established by law. Elimination of product defects is carried out as soon as possible, but cannot exceed 45 days; replacement of goods of inadequate quality is carried out within a month from the date of presentation of such a requirement.</p>\n<p>Contacts:</p>\n<p>+48 XXXXXXXXX</p>\n<p>not_manager@darth-shop.com</p>\n<p><a href=\"http://localhost:8080/en/content/6-contacts\">To submit a written application, use the details indicated on the Contacts page</a></p>','returns'),
